import React from 'react';
import style from "./Content.module.css";

const Content = (props) => {

    return (
        <section className={style.content}>
            <header>Все сервисы</header>
            {

                props.list.map(item => {

                        return (
                            <div key={item.id}>
                                <div style={{display: "flex"}}>
                                    <div>name</div>
                                    <div>{item.name}</div>
                                </div>
                                <div style={{display: "flex"}}>
                                    <div>login</div>
                                    <div>{item.login}</div>
                                </div>
                                <div style={{display: "flex"}}>
                                    <div>password</div>
                                    <div>{item.pass}</div>
                                </div>
                            </div>
                        )
                    }
                )
            }
        </section>
    );
};

export default Content;
